import Slots from "./Slots";
import "./Styles.css";

const Results = (props) => {
  console.log(props.data);
  return (
    <div>
      <h1>Results</h1>
      {props.data.map((center) => {
        return (
          <div>
            <Timebar />
            <Slots
              key={center.center_id}
              slots={center}
              className="mar_small"
            />
          </div>
        );
      })}
    </div>
  );
};

export default Results;
